// FinancialData.js
import React, { useState, useEffect } from 'react';

const FinancialData = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [sortBy, setSortBy] = useState('');
  const [order, setOrder] = useState('asc');
  const [filterBy, setFilterBy] = useState('');
  const [filterValueMin, setFilterValueMin] = useState('');
  const [filterValueMax, setFilterValueMax] = useState('');
  const [error, setError] = useState('');

  const fetchData = async () => {
    setLoading(true);
    try {
      let url = 'http://localhost:5000/api/data?';
      
      // Append query parameters for sorting and filtering
      if (sortBy) url += `sort_by=${sortBy}&order=${order}&`;
      if (filterBy) {
        url += `filter_by=${filterBy}&`;
        if (filterValueMin) url += `filter_value_min=${filterValueMin}&`;
        if (filterValueMax) url += `filter_value_max=${filterValueMax}&`;
      }

      const response = await fetch(url);
      const result = await response.json();

      if (response.ok) {
        setData(result);
      } else {
        setError(result.error || 'Something went wrong');
      }
    } catch (err) {
      setError('Error fetching data: ' + err.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchData();
  }, [sortBy, order, filterBy, filterValueMin, filterValueMax]);

  const handleSort = (column) => {
    if (sortBy === column) {
      setOrder(order === 'asc' ? 'desc' : 'asc');
    } else {
      setSortBy(column);
      setOrder('asc');
    }
  };

  const handleFilter = () => {
    fetchData();
  };

  return (
    <div>
      <h1>Financial Data</h1>

      {/* Filters */}
      <div>
        <label>Filter by: </label>
        <select onChange={(e) => setFilterBy(e.target.value)} value={filterBy}>
          <option value="">Select Filter</option>
          <option value="date">Date</option>
          <option value="revenue">Revenue</option>
          <option value="netIncome">Net Income</option>
        </select>
        <input
          type="text"
          placeholder="Min"
          value={filterValueMin}
          onChange={(e) => setFilterValueMin(e.target.value)}
        />
        <input
          type="text"
          placeholder="Max"
          value={filterValueMax}
          onChange={(e) => setFilterValueMax(e.target.value)}
        />
        <button onClick={handleFilter}>Apply Filters</button>
      </div>

      {/* Sorting */}
      <div>
        <button onClick={() => handleSort('date')}>Sort by Date</button>
        <button onClick={() => handleSort('revenue')}>Sort by Revenue</button>
        <button onClick={() => handleSort('netIncome')}>Sort by Net Income</button>
      </div>

      {/* Data Display */}
      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p>{error}</p>
      ) : (
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Revenue</th>
              <th>Net Income</th>
              <th>Gross Profit</th>
              <th>EPS</th>
              <th>Operating Income</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item.date}>
                <td>{item.date}</td>
                <td>{item.revenue}</td>
                <td>{item.netIncome}</td>
                <td>{item.grossProfit}</td>
                <td>{item.eps}</td>
                <td>{item.operatingIncome}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default FinancialData;
